import UIKit

import Foundation
class PointingProgram : NSObject {
     var missionText : String = ""
    var pointedLocations : [(Int,Int)]?
    var rover : Rover?
    
    func startNewRover(withStartingCoordinates : (CGFloat,CGFloat)){
        
        let rover = Rover()
        rover.currentX = Int(withStartingCoordinates.0)
        rover.currentY = Int(withStartingCoordinates.1)
        self.rover = rover
        
    }
    
   
    
}






